package com.ufgov.zc.server.bi.publish.impl.exporter;import java.util.List;import com.ufgov.zc.common.bi.model.BiIncome;import com.ufgov.zc.common.bi.publish.IBiIncomeServiceDelegate;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.server.system.SpringContext;public class BiIncomeServiceExporter implements IBiIncomeServiceDelegate {  private IBiIncomeServiceDelegate delegate = (IBiIncomeServiceDelegate) SpringContext  .getBean("biIncomeServiceDelegate");  public String genBiIncomeId(BiIncome biIncome, RequestMeta requestMeta) {    return this.delegate.genBiIncomeId(biIncome, requestMeta);  }  public List getBiIncome(ElementConditionDto dto, RequestMeta requestMeta) {    return delegate.getBiIncome(dto, requestMeta);  }  public void saveBiIncomeFN(List insertList, List updateList, RequestMeta requestMeta) {    this.delegate.saveBiIncomeFN(insertList, updateList, requestMeta);  }  public void deleteBiIncomeFN(List biIncomeIdList, RequestMeta requestMeta) {    this.delegate.deleteBiIncomeFN(biIncomeIdList, requestMeta);  }  public void auditBiIncomeFN(List biIncomeList, RequestMeta requestMeta) {    this.delegate.auditBiIncomeFN(biIncomeList, requestMeta);  }  public void unAuditBiIncomeFN(List biIncomeList, RequestMeta requestMeta) {    this.delegate.unAuditBiIncomeFN(biIncomeList, requestMeta);  }}